package com.company;import java.util.Arrays;import java.util.List;import java.util.Scanner;import java.util.stream.Collectors;public class ChangeList_02 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        List<Integer> numbers = Arrays.stream(scanner.nextLine().split("\\s+"))                .map(Integer::parseInt).collect(Collectors.toList());        String input = scanner.nextLine();        while (!input.equals("end")) {            String[] command = input.split("\\s+");            switch (command[0]) {                case "Delete":                    for (int i = 0; i < numbers.size(); i++) {                        if (numbers.get(i) == Integer.parseInt(command[1])) {                            numbers.remove(Integer.valueOf(command[1]));                        }                    }                    break;                case "Insert":                    int element = Integer.parseInt(command[1]);                    int posistion = Integer.parseInt(command[2]);                    numbers.add(posistion, element);                    break;            }            input = scanner.nextLine();        }        for (Integer number : numbers) {            System.out.print(number + " ");        }    }}